INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACGLO', 'STOCK', 'Arch Capital Group Ltd.', 'NMS', 'Financial Services', 'Insurance - Diversified', 'Arch Capital Group Ltd. is a Bermuda-based company, which provides insurance, reinsurance and mortgage insurance through its subsidiaries. The insurance segment consists of the Companys insurance underwriting units, which offer specialty product lines, including construction and national accounts; excess and surplus casualty; professional lines; programs; property, energy, marine and aviation; travel, accident and health; warranty and lenders solutions, and others (consisting of alternative markets, excess workers'' compensation and surety business). The reinsurance segment consists of its reinsurance underwriting units, which offer specialty product lines, including casualty; marine and aviation; other specialty; property catastrophe; property excluding property catastrophe, and other (consisting of life reinsurance and other). The mortgage segment includes its United States primary mortgage insurance business, investment and services related to United States credit-risk transfer.', 'Pembroke, , Bermuda', 7200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATNI', 'STOCK', 'ATN International, Inc.', 'NMS', 'Communication Services', 'Telecom Services', 'ATN International, Inc. is a provider of digital infrastructure and communications services. The Company operates in the United States and internationally, including the Caribbean region. Its segments include International Telecom and US Telecom. The International Telecom segment provides mobility services, fixed services, carrier services, and managed services in Bermuda, the Cayman Islands, Guyana, and the US Virgin Islands. The US Telecom segment also provides fixed services, carrier services, mobility services, and managed services in Alaska and the western United States. Through its subsidiaries, it provides fixed and mobile telecommunications connectivity to residential, business and government customers, including a range of high-speed Internet and data services, fixed and mobile wireless solutions, video and voice services, and carrier communications services, such as communications tower facilities to business, government, terrestrial, and submarine fiber optic transport.', 'Beverly, MA, United States', 2300);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRDB', 'STOCK', 'Roman DBDR Acquisition Corp. II', 'NGM', 'Financial Services', 'Shell Companies', 'Roman DBDR Acquisition Corp. II is a blank check company. The Company may pursue an initial Business Combination target in any stage of its corporate evolution or in any industry or sector, the Company intends to focus its initial search on companies in the cybersecurity, artificial intelligence (AI) or financial technology (FinTech) industries. It has not commenced any operations and generated no revenues.', 'Boca Raton, FL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMSC', 'STOCK', 'CMS Energy Corporation 5.875% J', 'NYQ', NULL, NULL, 'A CMS Energy Corporation é uma empresa de energia que opera principalmente em Michigan. Gere os seus negócios pela natureza dos serviços que cada um presta e opera principalmente em três segmentos de negócio: Electric Utility, Gás Utility e Northstar Clean Energy. O segmento de Utilidade Elétrica consiste em atividades regulamentadas associadas à geração, compra, distribuição e venda de eletricidade em Michigan. O segmento de Gás Utility consiste em atividades regulamentadas associadas à compra, transmissão, armazenamento, distribuição e venda de gás natural em Michigan. O segmento de Energia Limpa Northstar consiste em várias subsidiárias que se envolvem na produção de energia independente nacional, incluindo o desenvolvimento e operação de geração renovável, e a comercialização de produção de energia independente. Seu sistema de transmissão, armazenamento e distribuição de gás consiste em 2 342 quilômetros de linhas de transmissão com 15 campos de armazenamento de gás com uma capacid', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMA', 'STOCK', 'Destra Multi-Alternative Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Multi-Strategy Growth & Income Fund is a closed ended balanced mutual fund launched and managed by Pinhook Capital, LLC. It invests in public equity and fixed income markets of the United States. For its equity portion, the fund primarily invests directly, in other funds, and through derivatives such as options to invest in stocks of companies operating in the real estate sector, including real estate investment trusts. It invests in stocks of companies across all market capitalizations. For its fixed income portfolio, the fund invests in structured notes, notes, bonds and asset-backed securities. It employs a combination of fundamental and quantitative analysis while focusing on factors such as highest expected income, potential for capital appreciation, and relatively low volatility to create its portfolio. Multi-Strategy Growth & Income Fund was formed on June 3, 2011 and is domiciled in the United States.', 'San Diego, CA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ABLV', 'STOCK', 'Able View Global Inc.', 'NCM', 'Communication Services', 'Advertising Agencies', 'Able View Global Inc is a holding company principally engaged in comprehensive brand management of international beauty and personal care brands in China. The Company is engaged in purchasing from global brand owners and conduct sales in China. The Company''s businesses include strategy, branding, digital and social marketing, omni-channel sales, customer service, overseas logistics, warehouse and fulfilment.', 'Shanghai, , China', 89);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEAT', 'STOCK', 'YieldMax Dorsey Wright Featured 5 Income ETF', 'NGM', NULL, NULL, 'The index uses the Nasdaq Dorsey Wright Relative Strength Matrix methodology (the “Dorsey Wright methodology”) to select the securities included in the index. The Advisor attempts to invest all, or substantially all, of its assets in the index constituents that make up the index. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAFG', 'STOCK', 'Pacer US Small Cap Cash Cows Growth Leaders ETF', 'NGM', NULL, NULL, 'The index uses a rules-based methodology that seeks to provide exposure to small-capitalization U.S. companies with above average free cash flow margins. Under normal circumstances, the fund will seek to invest at least 80% of its net assets, plus the amount of any borrowings for investment purposes, in securities of small-capitalization companies (“small cap”) that are principally traded in the United States. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIZN', 'STOCK', 'Assurant, Inc. 5.25% Subordinat', 'NYQ', NULL, NULL, 'A Assurant, Inc. É uma empresa de proteção global que faz parceria com várias marcas para proteger e prestar serviços de dispositivos conetados, residências e automóveis. Ele utiliza soluções tecnológicas orientadas por dados para fornecer experiências aos clientes. Atua na América do Norte, América Latina, Europa e Ásia-Pacífico por meio de dois segmentos operacionais: Global Lifestyle e Global Housing. A Global Lifestyle Segment fornece soluções de dispositivos móveis, contratos de serviços estendidos e serviços relacionados para eletrônicos e eletrodomésticos de consumo e outros produtos de seguros (referidos como Vida Conectada), e serviços de proteção de veículos, serviços de equipamentos comerciais e outros serviços relacionados (referidos como Global Automotive). O segmento de habitação global fornece proprietários de imóveis, habitação manufaturada e seguro de inundação, bem como habitação manufaturada voluntária, seguro de condomínio e proprietários (referidos como proprietári', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNSP', 'STOCK', 'CNS Pharmaceuticals, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'CNS Pharmaceuticals, Inc. is a clinical-stage pharmaceutical company developing a pipeline of anti-cancer drug candidates for the treatment of primary and metastatic cancers of the brain and central nervous system. The Company''s drug candidate, Berubicin, is the first anthracycline to appear to cross the blood-brain barrier. Berubicin is the subject of the Company''s late-stage, fully-enrolled, global clinical trial for the treatment of glioblastoma multiforme (GBM), an aggressive and incurable form of brain cancer. The Company''s drug candidate, TPI 287, is an abeotaxane which stabilizes microtubules and inhibits cell division, causing apoptosis and cell death. TPI 287 has shown the potential to cross the blood-brain barrier and treat central nervous system (CNS) tumors.', 'Houston, TX, United States', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPYPP', 'STOCK', 'Brookfield Property Partners L.P.', 'NMS', 'Real Estate', 'Real Estate Services', 'Brookfield Property Partners, through Brookfield Property Partners L.P. and its subsidiary Brookfield Property REIT Inc., is one of the world''s premier real estate companies, with approximately $88 billion in total assets. We own and operate iconic properties in the world''s major markets, and our global portfolio includes office, retail, multifamily, logistics, hospitality, triple net lease, manufactured housing and student housing. Brookfield Property Partners is the flagship listed real estate company of Brookfield Asset Management Inc., a leading global alternative asset manager with over $600 billion in assets under management. More information is available at www.brookfield.com. Brookfield Property Partners L.P. operates as a subsidiary of Brookfield Corporation.', 'Hamilton, , Bermuda', 25700);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARTNA', 'STOCK', 'Artesian Resources Corporation', 'NMS', 'Utilities', 'Utilities - Regulated Water', 'Artesian Resources Corporation operates as a holding company of wholly owned subsidiaries offering water and wastewater services, and a number of other related core business services, on the Delmarva Peninsula. The Company operates its businesses primarily through the Regulated Utility segment. The segment includes an aggregation of its five regulated utility subsidiaries that are in the business of providing regulated water and wastewater services on the Delmarva Peninsula. Its regulated water utility services include treating, distributing, and selling water to residential, commercial, industrial, governmental, municipal and utility customers throughout the State of Delaware and in Cecil County, Maryland and to a residential community in Chester County, Pennsylvania. Its regulated wastewater utility services include the treatment and disposal of wastewater for customers in Sussex County, Delaware. The Companys principal subsidiary is Artesian Water Company, Inc.', 'Newark, DE, United States', 245);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMU', 'STOCK', 'Invesco BulletShares 2030 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2030 (collectively, “2030 Bonds”). It does not purchase all of the securities in the index; instead, the fund utilizes a "sampling" methodology to seek to achieve its investment objective.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASPS', 'STOCK', 'Altisource Portfolio Solutions S.A.', 'NMS', 'Real Estate', 'Real Estate Services', 'Altisource Portfolio Solutions SA is a Luxembourg-based integrated service provider for the real estate and mortgage industries. The Company offers portfolio management and related technology products, asset recovery, and customer relationship management services. It acts as a transaction solutions provider with the electronic payment management software and behavioral science-based analytics for the business processes, vendor, and marketplace participants. It also provides technology and solutions to mortgage servicing and origination clients as well as buyers and sellers of single-family residential real estate (single-family rental (SFR) solution) that helps improve operations, save money, reduce risk, and grow or liquidate portfolios.', 'Luxembourg City, , Luxembourg', 1160);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEPH', 'STOCK', 'Brookfield BRP Holdings (Canada', 'NYQ', NULL, NULL, NULL, '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CISS', 'STOCK', 'C3is Inc.', 'NCM', 'Industrials', 'Marine Shipping', 'C3is Inc is a Greece-based company. The Company operates as a holding, with subsidiaries primarily engaged in the seaborne transportation services of crude oil and dry bulk cargo for both state (national) and business clients. C3is Inc''s group include C3is Tanker, Eco Angelbay and Eco Bushfire. It operates globally through its subsidiaries, and the fleet of the group of companies consists of two handysize drybulk carriers: Eco Bushfire and Eco Angelbay, as well as one Aframax crude oil tanker, which is focused on short-term time charters and spot market voyages. C3is Inc serves both commercial and state sector entities involved in the production, trading and other applications of commodities.', 'Athens, , Greece', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EDAP', 'STOCK', 'EDAP TMS S.A.', 'NGM', 'Healthcare', 'Medical Distribution', 'Edap Tms SA is a France-based company that develops, manufactures, promotes and distributes minimally invasive medical devices for urology based upon ultrasound technology. The Company''s activity is organized in two divisions: HIFU (High Intensity Focused Ultrasound) and ESWL (Extracorporeal ShockWave Lithotripsy) that invests in research and development, partnering with INSERM French public laboratory and international medical research institutions. It specialises in HIFU technology, a non-invasive treatment of prostate conditions with a range of Robotic HIFU devices, Ablatherm Fusion and Focal One, ESWL and Stone Laser that offers a range of minimally invasive solutions covering the full scope of urinary tract stone indications. It also operates worldwide via a network of corporate offices, subsidiaries and distribution partners', 'Vaulx-en-Velin, , France', 310);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFS', 'STOCK', 'Saul Centers, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Saul Centers, Inc. is a self-managed, self-administered equity real estate investment trust (REIT). The Company, which conducts all of its activities through its subsidiaries, the Operating Partnership and Subsidiary Partnerships, engages in the ownership, operation, management, leasing, acquisition, renovation, expansion, development and financing of community and neighborhood shopping centers and mixed-used properties, primarily in the Washington, DC/Baltimore metropolitan area. The Company operates through two business segments: Shopping Centers and Mixed-Use Properties. The Company operates and manages a real estate portfolio comprised of approximately 62 properties, which includes 58 community and neighborhood shopping centers and mixed-use properties with approximately 10.2 million square feet of leasable area, and four land and development properties.', 'Bethesda, MD, United States', 141);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CBFV', 'STOCK', 'CB Financial Services, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'CB Financial Services, Inc. is the bank holding company. The Company conducts its operations primarily through its wholly owned subsidiary, Community Bank (the Bank). The Bank offers range of residential and commercial real estate loans, commercial and industrial loans, and consumer loans and deposit products for individuals and businesses in its market area. The Company''s principal lending activity has been the origination in its local market area of residential one- to-four-family , commercial real estate, construction, and others. Its residential real estate loans are comprised of loans secured by one- to-four-family residential properties. It provides loans to individuals to finance the construction of residential dwellings, construction of commercial properties, including hotels, and apartment buildings. Its investment portfolio includes United States Government Agency Securities, Obligations of States and Political Subdivisions, Mortgage-Backed Securities, and Corporate Debt.', 'Carmichaels, PA, United States', 159);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMT', 'STOCK', 'Invesco BulletShares 2029 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2029 (collectively, “2029 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FCEF', 'STOCK', 'First Trust Income Opportunity ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objectives by investing in a portfolio of closed-end investment companies ("closed-end funds") and exchange-traded funds ("ETFs") that are listed and traded in the United States on registered exchanges. In selecting the closed-end funds and ETFs for the fund’s portfolio, the fund''s investment advisor utilizes a range of investment approaches.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVG', 'STOCK', 'Eaton Vance Short Duration Diversified Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Eaton Vance Short Duration Diversified Income Fund is a closed ended fixed income mutual fund launched and managed by Eaton Vance Management. The fund invests in fixed income markets of the United States. It primarily invests in senior, secured floating-rate loans, bank deposits denominated in foreign currencies, debt obligations of foreign governmental and corporate issuers, and mortgage-backed securities. The fund invests in fixed income securities operating across diversified sectors. It invests in fixed income securities with an average duration of 1.76 years and an average credit quality of least BBB. The fund benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index. It was formerly known as Eaton Vance Low Duration Diversified Income Fund. Eaton Vance Short Duration Diversified Income Fund was formed on February 28, 2005 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTB', 'STOCK', 'DTE Energy Company 2020 Series ', 'NYQ', NULL, NULL, 'A DTE Energy Company é uma empresa diversificada de energia, que está envolvida no desenvolvimento e gestão de negócios e serviços relacionados à energia em todo o país. Os segmentos da empresa incluem Electric, Gás, DTE Vantage, Energy Trading, Corporate e outros. O segmento elétrico consiste principalmente na DTE Electric, que está envolvida na geração, compra, distribuição e venda de eletricidade para clientes residenciais, comerciais e industriais no sudeste do Michigan. O segmento de gás consiste principalmente na DTE Gás, que está envolvida na compra, armazenamento, transporte, distribuição e venda de gás natural para clientes residenciais, comerciais e industriais em todo Michigan. O segmento DTE Vantage é composto principalmente de projetos de energia renovável que vendem eletricidade e gás de gasoduto e projetos que fornecem soluções de energia personalizada para clientes industriais, comerciais e institucionais. O segmento de Energy Trading consiste em operações de marketing ', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMSD', 'STOCK', 'CMS Energy Corporation 5.875% J', 'NYQ', NULL, NULL, 'A CMS Energy Corporation é uma empresa de energia que opera principalmente em Michigan. Gere os seus negócios pela natureza dos serviços que cada um presta e opera principalmente em três segmentos de negócio: Electric Utility, Gás Utility e Northstar Clean Energy. O segmento de Utilidade Elétrica consiste em atividades regulamentadas associadas à geração, compra, distribuição e venda de eletricidade em Michigan. O segmento de Gás Utility consiste em atividades regulamentadas associadas à compra, transmissão, armazenamento, distribuição e venda de gás natural em Michigan. O segmento de Energia Limpa Northstar consiste em várias subsidiárias que se envolvem na produção de energia independente nacional, incluindo o desenvolvimento e operação de geração renovável, e a comercialização de produção de energia independente. Seu sistema de transmissão, armazenamento e distribuição de gás consiste em 2 342 quilômetros de linhas de transmissão com 15 campos de armazenamento de gás com uma capacid', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMP', 'STOCK', 'Invesco BulletShares (R) 2025 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2025 (collectively, “2025 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AARD', 'STOCK', 'Aardvark Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Aardvark Therapeutics, Inc. is a clinical-stage biopharmaceutical company focused on developing novel, small-molecule therapeutics to activate innate homeostatic pathways for the treatment of metabolic diseases. The Company targets biological pathways associated with alleviating hunger that has the potential to deliver transformative outcomes for patients. It is focused on developing selective compounds, targeting Bitter Taste Receptors (TAS2Rs) for hunger-associated conditions. Its initial compounds target TAS2Rs expressed in the gut lumen, which normally respond to the nutrients in food and participate in the gut-brain axis. Its wholly owned lead product candidate, ARD-101 (denatonium acetate monohydrate), is an oral gut-restricted small-molecule agonist of certain TAS2Rs expressed in the gut lumen for which it has initiated a Phase III clinical trial for hyperphagia associated with Prader-Willi Syndrome (PWS).', 'San Diego, CA, United States', 26);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLPS', 'STOCK', 'CLPS Incorporation', 'NGM', 'Technology', 'Information Technology Services', 'CLPS Incorporation is a China-based holding company principally engaged in the provision of information technology (IT), consulting and solution services. The Company is focused on delivering services to global institutions in banking, insurance and financial sectors, both in China and globally. The Company conducts its businesses mainly through three segments, including Fintech IT Consulting Service segment, Customized IT Solution Service segment and Other segment. The Companys consulting services include credit card services and core banking services. It offers IT consulting services across various credit card business areas, including credit card applications, account setup, authorization and activation, settlement, collection, promotion, point system, anti-fraud, statement, reporting and risk management. The Company conducts its businesses in domestic and overseas markets.', 'Kwun Tong, , Hong Kong', 3642);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFA', 'STOCK', 'First Trust Enhanced Equity Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'First Trust Enhanced Equity Income Fund is a closed-ended equity mutual fund launched and managed by First Trust Advisors L.P. The fund is co-managed by Chartwell Investment Partners, L.P. It invests in public equity markets of the United States. The fund seeks to invest in stocks of companies operating across the diversified sectors. It invests in stocks of companies across diversified market capitalizations. The fund also writes covered call options. It benchmarks the performance of its portfolio against the S&P 500 Index. The fund was formerly known as First Trust/Fiduciary Asset Management Covered Call Fund. First Trust Enhanced Equity Income Fund was formed on August 26, 2004 and is domiciled in the United States.', 'Wheaton, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARGD', 'STOCK', 'Argo Group U.S., Inc.', 'NYQ', NULL, NULL, 'Argo Group US, Inc. is an insurance company, which is an underwriter of specialty insurance products in the property and casualty market. The Company operates through two segments: U.S. Operations and International Operations. The U.S. Operations segment is focused on the United States specialty insurance market, specifically through its Excess and Surplus Lines (E&S) businesses focusing on United States based risks. The International Operations segment focuses on specialty property insurance, property catastrophe reinsurance, primary/excess casualty, professional liability, and marine and energy insurance. This segment also includes a Bermuda trading platform. The Companys business includes Argo Casualty, Argo Construction, Argo Environmental, Argo Marine, Argo Pro, Argo Property, Argo Surety, Colony Specialty, Rockwood, and Specialty Programs.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDC', 'STOCK', 'VictoryShares US EQ Income Enhanced Volatility Wtd ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal market conditions, at least 80% of its assets directly or indirectly in the securities included in the Nasdaq Victory U.S. Large Cap 100 High Dividend Long/Cash Volatility Weighted Index. The index identifies the 100 highest dividend yielding stocks in the Nasdaq Victory U.S. Large Cap 500 Volatility Weighted Index.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AUNA', 'STOCK', 'Auna SA', 'NYQ', 'Healthcare', 'Medical Care Facilities', 'Auna SA is a Luxembourg-based healthcare company. The Company has a patient- centric model providing prepaid healthcare plans, medical care, and oncology solutions, that promotes integrated healthcare system, healthy lifestyles through prevention, research, and education. It offers a wide-ranging practice and prospects that enables to deliver standard services and the possible patient outcomes. Its network includes nearly 31 healthcare network facilities, consisting of regional network of hospitals, clinics, outpatient, and wellness facilities with a total of 2,308 beds. It is also located in Mexico, Peru, and Colombia.', 'Luxembourg, , Luxembourg', 14605);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWB', 'STOCK', 'Bridgewater Bancshares, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'Bridgewater Bancshares, Inc. is a financial holding company with one wholly owned subsidiary, Bridgewater Bank (the Bank). The Bank focuses primarily on commercial lending, consisting of loans secured by nonfarm, nonresidential properties, loans secured by multifamily residential properties, nonowner occupied single family residential properties, construction loans, land development loans and commercial and industrial loans. The Bank offers loan and deposit products primarily for commercial clients. The Bank also offers consumers traditional retail deposit products through its branch network, along with online, mobile, and direct banking channels. The Bank has developed a suite of deposit products targeted at commercial clients, including a variety of remote deposit and cash management products, along with commercial transaction accounts. The Bank has nine full-service offices located in Bloomington, Greenwood, Minneapolis (two), St. Louis Park, Orono, and St. Paul, Minnesota.', 'Saint Louis Park, MN, United States', 308);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CXSE', 'STOCK', 'WisdomTree China ex-State-Owned Enterprises Fund', 'NGM', NULL, NULL, 'Under normal circumstances, at least 80% of the fund''s total assets (exclusive of collateral held from securities lending) will be invested in constituent securities of the index and investments that have economic characteristics that are substantially identical to the economic characteristics of such constituent securities. The index is a modified float-adjusted market cap weighted index that consists of common stocks in China, excluding common stocks of "state-owned enterprises." The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIRG', 'STOCK', 'Airgain, Inc.', 'NCM', 'Technology', 'Communication Equipment', 'Airgain, Inc. is a provider of advanced wireless connectivity solutions that is focused on developing 5G technology. The Company''s diverse product portfolio serves three primary markets: enterprise, automotive, and consumer. Its enterprise products include Smart Network Controlled Cellular Repeaters (Smart NCRs), fixed wireless access (FWA) devices, asset tracking solutions, embedded cellular modems, and antennas for access points and Internet of Things (IoT) applications. Its Lighthouse 5G Smart Network Control Repeater delivers a scalable, high-performance solution designed to deploy and enhance network coverage and offload network capacity for the underserved areas. Its automotive products include its second generation AirgainConnect Fleet system solution - a low profile, roof-mounted, all-in-one 5G vehicle gateway and aftermarket antennas. Its consumer products are comprised of embedded antennas for consumer access points, wireless gateways, smart home devices and FWA devices.', 'San Diego, CA, United States', 121);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DCOMP', 'STOCK', 'Dime Community Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Dime Community Bancshares, Inc. is a bank holding company. The Company is engaged in providing commercial banking and financial services through its wholly owned subsidiary, Dime Community Bank (the Bank). The Bank is engaged in providing full-service commercial and consumer banking services, including accepting time, savings and demand deposits from businesses, consumers, and local municipalities. It also offers the Certificate of Deposit Account Registry Service (CDARS) and Insured Cash Sweep (ICS) programs. In addition, it offers merchant credit and debit card processing, automated teller machines, cash management services, lockbox processing, online banking services, remote deposit capture, safe deposit boxes, and individual retirement accounts, as well as investment services through Dime Financial Services LLC. Through its title insurance subsidiary, the Bank acts as a broker for title insurance services.', 'Hauppauge, NY, United States', 887);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAFE', 'STOCK', 'Brown Advisory Flexible Equity ETF', 'NGM', NULL, NULL, 'Under normal conditions, Brown Advisory LLC (the “Adviser”) seeks to achieve the fund’s investment objective by investing at least 80% of the value of its net assets (plus any borrowings for investment purposes) in equity securities. The fund invests primarily in a portfolio of equity securities issued by large, middle, and small capitalization companies that the Adviser believes have strong, or improving, long-term business characteristics and share prices that do not reflect certain favorable fundamental attributes.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AENT', 'STOCK', 'Alliance Entertainment Holding Corporation', 'NCM', 'Communication Services', 'Entertainment', 'Alliance Entertainment Holding Corporation is a distributor of music, movies, toys, collectibles, and consumer electronics. The Company offers over 325,000 in-stock keeping units (SKUs), including over 57,300 exclusive compact discs, vinyl LP records, digital video discs (DVDs), Blu-ray, and video games. Its diverse portfolio of retail brands includes Critics Choice, Collectors Choice, Movies Unlimited, DeepDiscount, popmarket, blowitoutahere, Fulfillment Express, importCDs, GamerCandy, WowHD, and others. Its services include direct-to-consumer (DTC), and e-commerce. It distributes physical media, entertainment products, hardware, and accessories across various platforms. It operates as a renowned supplier of music labels, home video studios, video game publishers, and collectibles of entertainment content, such as Universal Pictures, Warner Brothers Home Video, Walt Disney Studios, Sony Pictures, Lionsgate, Paramount, Universal Music Group, Sony Music, Microsoft, and others.', 'Plantation, FL, United States', 657);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CZWI', 'STOCK', 'Citizens Community Bancorp, Inc.', 'NGM', 'Financial Services', 'Banks - Regional', 'Citizens Community Bancorp, Inc. is a bank holding company for Citizens Community Federal N.A. (the Bank). The Bank is a federally chartered national bank serving customers in Wisconsin and Minnesota. Its primary markets include the Chippewa Valley Region in Wisconsin, the Twin Cities and Mankato markets in Minnesota, and various rural communities around these areas. The Bank offers traditional community banking services to businesses, agricultural operators and consumers, including one-to-four family residential mortgages. The Bank offers a variety of loan products including commercial real estate loans, commercial and industrial (C&I) loans, agricultural real estate loans, agricultural operating loans, residential mortgages, home equity lines-of-credit and consumer loans. It maintains a portfolio of investments, consisting primarily of mortgage-backed securities, asset-backed securities, the United States Government sponsored agency securities and corporate debt securities.', 'Eau Claire, WI, United States', 207);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWD', 'STOCK', 'CaliberCos Inc.', 'NCM', 'Financial Services', 'Asset Management', 'CaliberCos Inc. is a diversified alternative asset management firm. The Company is engaged in building wealth for its clients by creating, managing, and servicing middle-market investment funds, private syndications, and direct investments. Through its funds, the Company invests primarily in real estate, private equity, and debt facilities. The Company markets and fundraises to direct channels and to wholesale channels. Its asset management activities are complemented with transaction and advisory services, including development and construction management, acquisition and disposition expertise, and fund formation. The Company provides various support services to the investments it manages, including asset management services, fund set-up services, lending support, construction and development management, and real estate brokerage.', 'Scottsdale, AZ, United States', 81);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEP', 'STOCK', 'First Trust Europe AlphaDEX Fund', 'NGM', NULL, NULL, 'The fund will normally invest at least 90% of its net assets (including investment borrowings) in the securities that comprise the index. The index is designed to select stocks from the NASDAQ Europe Index (the "base index") that may generate positive alpha, or risk-adjusted returns, relative to traditional indices through the use of the AlphaDEX® selection methodology.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BETR', 'STOCK', 'Better Home & Finance Holding Company', 'NGM', 'Financial Services', 'Mortgage Finance', 'Better Home & Finance Holding Company is an artificial intelligence (AI) home finance company. The Company is an AI-powered mortgage lender and fintech company. Its AI platform, Tinman, allows customers to see their rate options in seconds, get pre-approved in minutes, lock in rates, and close their loan in three weeks. In addition, Betsy, a voice-based AI loan assistant built exclusively for the mortgage industry that delivers timely application status updates to consumers, answering questions, and moving their loan application along 24/7/365. It offers Home Finance (home loan) products and Better Plus (non-mortgage) products, including real estate services and insurance products. Its mortgage offerings include government-sponsored enterprises (GSE)-conforming mortgage loans, U.S. Federal Housing Administration (FHA) and Veterans Affairs (VA) loans, and jumbo mortgage loans. Its suite of non-mortgage products includes Better Real Estate, Better Settlement Services, and Better Cover.', 'New York, NY, United States', 1250);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYFI', 'STOCK', 'IDX Dynamic Fixed Income ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund (“ETF”) that is a “fund of funds,” meaning that it normally invests at least 80% of its net assets, including any borrowings for investment purposes, in other ETFs that invest in various sectors of the debt markets, including corporate bonds, U.S. government and agency securities, private debt, foreign bonds (including emerging markets), foreign sovereign bonds, convertible securities, Treasury Inflation Protected Securities (TIPS), bank loans, asset-backed securities, mortgage-backed securities, and cash equivalent instruments. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FDIV', 'STOCK', 'MarketDesk Focused U.S. Dividend ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund (“ETF”) that is sub-advised by MarketDesk Indices LLC (“Sub-Adviser”). The fund seeks to achieve its investment objective by investing at least 80% of its net assets, plus the amount of any borrowing for investment purposes, in a portfolio of U.S. companies that pay dividends and expect to grow the dividend over time.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYNXU', 'STOCK', 'Dynamix Corporation', 'NGM', 'Financial Services', 'Shell Companies', 'Dynamix Corporation does not have significant operations. It intends to effect a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses in the energy and power sectors. The company was incorporated in 2024 and is based in Houston, Texas.', 'Houston, TX, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLWT', 'STOCK', 'Euro Tech Holdings Company Limited', 'NCM', 'Industrials', 'Pollution & Treatment Controls', 'Euro Tech Holdings Company Limited is a distributor of a range of advanced water treatment equipment, laboratory instruments, analyzers, test kits and related supplies and power generation equipment (including recorders and power quality analyzers). The Company acts as a distributor for manufacturers of such equipment, primarily to commercial customers and governmental agencies or instrumentalities in Hong Kong and the People''s Republic of China (PRC). The Company operates two segments: Trading and manufacturing, and Engineering. It distributes analytical re-agents and chemicals to support testing systems of laboratory and portable instruments, process analyzers and portable test kits and assist in the analysis process. It distributes analytical instruments, environmental quality monitoring instruments, sample pre-treatment equipment and general purpose laboratory instruments. It provides systems engineering to waste-water treatment and power generation plants and beverage producers.', 'Hong Kong, , Hong Kong', 47);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRNY', 'STOCK', 'Burney U.S. Factor Rotation ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund (“ETF”) that seeks long term growth of capital. The fund seeks to achieve its investment objective by investing, under normal circumstances, at least 80% of the fund’s net assets plus the amount of any borrowings for investment purposes in U.S. listed common stock. The fund will invest its assets in common stocks of large, mid, and small-capitalization companies.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DTF', 'STOCK', 'DTF Tax-Free Income 2028 Term Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'DTF Tax-Free Income 2028 Term Fund Inc. is a closed-ended fixed income mutual fund launched by Virtus Investment Partners, Inc. The fund is managed by Duff & Phelps Investment Management Co. It invests primarily in a diversified portfolio of investment grade tax-exempt utility obligations. The fund invests in various sectors, such as water and sewer, electric utilities, prerefunded utilities, pollution control, and nonutilities. It invests in the fixed income markets of the United States. It was formerly known as DTF Tax-Free Income Inc. DTF Tax-Free Income 2028 Term Fund Inc. was formed on November, 1991 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSMV', 'STOCK', 'Invesco BulletShares 2031 Municipal Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated investment-grade municipal bonds with maturities or, in some cases, “effective maturities,” in the year 2031 (collectively, “2031 Bonds”).', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTEC', 'STOCK', 'Global X CleanTech ETF', 'NGM', NULL, NULL, 'The fund invests at least 80% of its total assets, plus borrowings for investments purposes, in the securities of the index and in ADRs, GDRs based on the securities in the index. The index is designed to provide exposure to exchange-listed companies that are positioned to benefit from the increased adoption of technologies focused on improving the efficiency of renewable energy production and/or mitigating the adverse environmental effects of resource consumption. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FKWL', 'STOCK', 'Franklin Wireless Corp.', 'NCM', 'Technology', 'Communication Equipment', 'Franklin Wireless Corp., doing business as FranklinAccess, is a global provider of integrated wireless solutions utilizing the latest fifth generation (5G) and fourth generation long-term evolution (4G LTE) technologies including mobile hotspots, fixed wireless routers, and mobile device management (MDM) solutions. It is an enabler of the Digital Divide initiative, and its expertise extends to Internet of Things (IOT) and machine-to-machine (M2M) applications, driving forward communication and connectivity for both individuals and enterprises. Its products include 5G/4G wireless broadband products, Smart Box Solutions (In Development), Quvo Family Guardian Solutions and JEXtream MDM/NMS Solutions. Its global customer base is comprised of wireless operators, strategic partners and distributors located in North America and Asia. Its subsidiary, Franklin Technology Inc., is a research and development company, which provides design and development services for its wireless products.', 'San Diego, CA, United States', 69);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('XTNT', 'STOCK', 'Xtant Medical Holdings, Inc.', 'ASE', 'Healthcare', 'Medical Devices', 'Xtant Medical Holdings, Inc. is a global medical technology company. The Company is focused on the design, development, and commercialization of a comprehensive portfolio of orthobiologics and spinal implant fixation systems to facilitate spinal fusion in complex spine, deformity, and degenerative procedures. Its products are used by orthopedic spine surgeons and neurosurgeons to treat a variety of spinal disorders in the cervical, thoracolumbar, and interbody spine. Its biomaterial products include OsteoSponge, OsteoSelect DBM putty, OsteoSelect Plus DBM putty, OsteoWrap, OsteoVive, OsteoFactor, line of 3Demin products, as well as other allografts. It offers a comprehensive line of products that are used to treat a variety of spinal and sacroiliac conditions, including trauma, degeneration, deformity and tumor. Its key spinal implant product lines include Cervical products, Thoracolumbar products, Sacroiliac Joint products, Interbody products and Interlaminar Stabilization products.', 'Belgrade, MT, United States', 217);\n
